import React, { Component } from 'react';
import { withHighcharts, HighchartsChart, Chart, XAxis, YAxis, Title, Legend, ScatterSeries } from 'react-jsx-highcharts';
import Highcharts from 'highcharts';
import addHighchartsMore from 'highcharts/highcharts-more';
import '../css/Chart.css'

addHighchartsMore(Highcharts);

class ScatterChart extends Component {
    constructor(props) {
        super(props);

        this.state = {
            data: [
                {
                    minTiming: 760,
                    '25thPercentile': 801,
                    medianTiming: 848,
                    '75thPercentile': 895,
                    maxTiming: 965
                }
            ]
        }
    }

    render() {
        const data = this.state.data[0];

        return (
            <div>
                <HighchartsChart>
                    <Chart zoomType="xy" onClick={this.handleClick} />

                    <Title>Click to add data</Title>

                    <Legend>
                        <Legend.Title>Legend</Legend.Title>
                    </Legend>

                    <XAxis>
                        <XAxis.Title>X Coord</XAxis.Title>
                    </XAxis>

                    <YAxis data={this.props.data.data}>
                        <YAxis.Title>Y Coord</YAxis.Title>
                        <ScatterSeries name="Patents" series={[
     {
      name: 'Office Manager',
      data: [{y: 0, low: new Date('2014-01-01').getTime(), high: new Date('2015-01-01').getTime()},
      {y: 0, low: new Date('2015-01-01').getTime(), high: new Date('2016-01-01').getTime()},
      {y: 0, low: new Date('2016-01-01').getTime(), high: new Date('2017-01-01').getTime()}],
      stacking: 'normal'
  },  {       
      name: 'CAD',
      data: [{y: 0, low: new Date('2015-01-01').getTime(), high: new Date('2016-01-01').getTime()},
      {y: 0, low: new Date('2016-01-01').getTime(), high: new Date('2017-01-01').getTime()},
      {y: 0, low: new Date('2017-01-01').getTime(), high: new Date('2018-01-01').getTime()}],
      stacking: 'normal'
  }, {
      name: 'STUFF',
      data: [{y: 0, low: new Date('2016-01-01').getTime(), high: new Date('2017-01-01').getTime()},
      {y: 0, low: new Date('2017-01-01').getTime(), high: new Date('2018-01-01').getTime()},
      {y: 0, low: new Date('2018-01-01').getTime(), high: new Date('2019-01-01').getTime()}],
      stacking: 'normal'
  },

    {
        type: 'scatter',
        name: 'scatter 1',
        color: 'red',
        data: [new Date('2016-06-01').getTime(), new Date('2017-06-01').getTime(), new Date('2018-06-01').getTime()],
        marker: { radius: 5 }
    }, {
        type: 'scatter',
        name: 'scatter 2',
        color: 'blue',
        data: [new Date('2014-03-01').getTime(), new Date('2015-03-01').getTime(), new Date('2016-03-01').getTime()],
        marker: { radius: 5 }
    }

    ]} />
                        <ScatterSeries name="Centroid" data={this.props.data.centroid} onHide={this.handleHide} onShow={this.handleShow} />
                    </YAxis>
                </HighchartsChart>
            </div>
        );
    }
}
export default withHighcharts(ScatterChart, Highcharts); // Injecting the Highcharts object
